let isTestCache = {}
function isTest(suiteName, dirName, fileName) {
    const path = `${__dirname}/${suiteName}/${dirName}/${fileName}`
    if(!(path in isTestCache)) {
        isTestCache[path] = fs.readFileSync(path, 'utf8').includes('import XCTest')
    }
    return isTestCache[path]
}

function transpile(suiteName, dirName, fileName) {
    return execSync(`/Users/bubulkowanorka/projects/swift-source/build/Ninja-RelWithDebInfoAssert/swift-macosx-x86_64/bin/swiftc -dump-ast -O -sdk /Applications/Xcode.app/Contents/Developer/Platforms/MacOSX.platform/Developer/SDKs/MacOSX10.14.sdk -F /Applications/Xcode.app/Contents/Developer/Platforms/MacOSX.platform/Developer/Library/Frameworks '${__dirname}/${suiteName}/${dirName}/${fileName}'`, {encoding: 'utf8', stdio: ['pipe', 'pipe', 'pipe']})
}

function executeTranspiled(code) {
    fs.writeFileSync(`${__dirname}/test.ts`, transpiledCode)
    return execSync(`ts-node --disableWarnings ${__dirname}/test.ts`, {encoding: 'utf8', stdio: ['pipe', 'pipe', 'pipe']})
}

function executeOriginal(suiteName, dirName, fileName) {
    return execSync(`swift '${__dirname}/${suiteName}/${dirName}/${fileName}'`, {encoding: 'utf8', stdio: ['pipe', 'pipe', 'pipe']})
}

function readdirSyncRecursive(base, suffix) {
    if(!suffix) suffix = ''
    var results = []
    var list = fs.readdirSync(`${base}/${suffix}`)
    list.forEach(function(file) {
        file = suffix + (suffix ? '/' : '') + file
        var stat = fs.statSync(base + '/' + file)
        if (stat && stat.isDirectory()) {
            /* Recurse into a subdirectory */
            results = results.concat(readdirSyncRecursive(base, file))
        } else {
            /* Is a file */
            results.push(file)
        }
    })
    return results
}

const collectFiles = {
    local: (dirName, fileNames) => fileNames,
    github: (dirName, fileNames) => {
        const testFileNames = fileNames.filter(fileName => isTest('github', dirName, fileName))
        let folders = {}
        testFileNames.forEach(testFileName => folders[testFileName.split('/')[0]] = true)
        return Object.keys(folders).map(folder => {
            let folderFileNames = fileNames.filter(fileName => fileName.startsWith(`${folder}/`)).sort((fileName0, fileName1) => {
                const isTest0 = isTest('github', dirName, fileName0), isTest1 = isTest('github', dirName, fileName1)
                return isTest0 === isTest1 ? 0 : isTest0 ? 1 : -1
            })
            let contents = ''
            for(const folderFileName of folderFileNames) {
                contents += fs.readFileSync(`${__dirname}/github/${dirName}/${folderFileName}`) + '\n\n'
            }
            let testInstances = contents.match(/[\S]+[\s]*\:[\s]*XCTestCase/g)
            if(testInstances) for(const testInstance of testInstances) {
                contents += "\n" + testInstance.split(":")[0] + "()"
            }
            fs.writeFileSync(`${__dirname}/github/${dirName}/${folder}/concat.swift`, contents)
            return `${folder}/concat.swift`
        })
    }
}

