let transpileI = 0
function getNextTranspileChunk() {
    let transpileINew = transpileLog.indexOf('$$$', transpileI)
    let transpileChunk = transpileLog.substring(transpileI, transpileINew)
    transpileI = transpileINew + '$$$\n'.length
    return transpileChunk
}

